import React, { Component } from 'react';
import './index.css';
import Cell from './Cell'

const gameBoardStyle = {
    width: '400px',
    height: '400px',
    tableLayout: 'fixed',
    background:'pink',
  };


class App extends React.Component {
    constructor() {
        super();
        this.state = {
          board: [1,2,3]
        };
      }
    
  render() {
    return (
      <div className="App">
        <header className="2048">
          <h1 className="App-title">2048</h1>
        </header>
        <div style={gameBoardStyle}>
            {this.state.board.map(function(d, idx){
            return (<Cell> 1</Cell>)
        })}
        </div>
      </div>
    );
  }
}



export default App;
